const Hello = (props) => {
  return (
    <div>
      <p>Hello {props.name}</p>
    </div>
  );
};

const App = () => {
  const now = new Date();
  const a = 10;
  const b = 20;
  console.log(now, a + b);

  return (
    <div>
      <h1>Greetings</h1>
      <Hello name="mateo" />
      <Hello name="ibo" />
      <Hello />
    </div>
  );
};
export default App;
